import React, { Component } from 'react';
import {connect} from 'react-redux'
import {getRawBlob} from './../../../actions/repo.actions'
import {getBlob} from './../../../reducers/repo.reducer';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';
import Icon from 'react-icons-kit';
import {ic_delete} from 'react-icons-kit/md/ic_delete';
import {ic_mode_edit} from 'react-icons-kit/md/ic_mode_edit';
import {ic_history} from 'react-icons-kit/md/ic_history'
import {ic_insert_drive_file} from 'react-icons-kit/md/ic_insert_drive_file'
import Typography from '@material-ui/core/Typography';

class FilePage extends Component {
  constructor(props){
    super(props)
    this.props.dispatch(getRawBlob(this.props.match.params.id,this.props.match.params.repo))
    this.goback=this.goback.bind(this);
    let user= this.props.match.params.user
    let repo= this.props.match.params.repo
    console.log(`/${user}/${repo}`);
  }
  goback(){
    let user= this.props.match.params.user
    let repo= this.props.match.params.repo
    console.log(user,repo);
    this.props.history.push(`/source/${user}/${repo}`);
  }
  render() {
    console.log(":::",this.props);
    if(this.props.file!==undefined&&this.props.file!==false)
    return (
      <div className="FilePage">
        <div className="Header">
          <div className="Title">
            <Typography id="overline">Project</Typography>
            <Typography variant="display4" onClick={this.goback} className="RepoName">{this.props.match.params.repo}</Typography>
          </div>
          <Typography variant="display3" className="Separator">/</Typography>
          <Typography variant="display3" className="FileName">{this.props.match.params.file}</Typography>
        </div>
        <div className="Info">
          <Paper>
            <div className="Header">
              <div className="Contributors">
                <Typography variant="body1">Contributors: coming soon</Typography>
              </div>
              <div className="Actions">
                <Button color="primary" disabled><Icon icon={ic_insert_drive_file}/>Raw</Button>
                <Button color="primary" disabled><Icon icon={ic_history}/>History</Button>
                <Button color="primary" disabled><Icon icon={ic_mode_edit}/>Edit</Button>
                <Button color="primary" disabled><Icon icon={ic_delete}/>Delete</Button>
              </div>
            </div>
            <div className="FileContents">
              {this.props.file.split("\n").map(word=>{
                return <code>{word}</code>
              })}
            </div>
          </Paper>
        </div>
      </div>
    );
    else return(<div>Loading</div>)
  }
}
const mapStateToProps=(state)=>{
  return {
    file: getBlob(state)
  }
}
export default connect(mapStateToProps)(FilePage);
